import React from 'react';
import classes from "./HomeSection2Body.module.css";
import { IoStopwatch, IoWine, IoRepeatOutline } from "react-icons/io5";


const HomeSection2Body = (props) => {
  return (
    <div className={classes.bodyContainer}>
    
      <div className={classes.tile}>
        <div className={classes.tileicon}><IoStopwatch /></div>
        <p className={classes.iconText}>Text part</p>
      </div>
      <div className={classes.tile}>
        <div className={classes.tileicon}><IoWine/></div>
        <p className={classes.iconText}>Text part</p>
      </div>
      <div className={classes.tile}>
        <div className={classes.tileicon}><IoRepeatOutline/></div>
        <p className={classes.iconText}>Text part</p>
      </div>
    </div>
  );
};

export default HomeSection2Body;
